function initPage(){ 
	if(g_Wizard == "true"){
		showDialogbox("wizard", "wizardStep2", "", 1);
		hideHTML('Navi_Box');
		hideHTML('Option_Box');
		showHTML('Wizard_Box');
		$('#Forward_Button').bind("click", function(){showDialogbox("actionWait", 'Ihr Modell wird gerade konfiguriert. Bitte warten...'); GetTd({"ModelWizard":{"cmd":1}}, g_SetEvent, "1");});
	}
	else{
		g_Wizard = false;
	}


	
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "FunctionPreselect");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "ModelTailType");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "OutputResolution");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "ModelWingCount");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "ModelElevatorCount");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "ModelRudderCount");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "YesNo");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "TypeSwashPlate");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "TypeGyroHeli");
	InitDataPostArgs = getPopupObj(InitDataPostArgs, "HeliCountSwashPlates");
	InitDataPostArgs = getNumPadLimitObj(InitDataPostArgs, "DegreeSigned180");
	InitDataPostArgs = getNumPadLimitObj(InitDataPostArgs, "DegreeUnsigned180");
	
	InitDataPostArgs = getCurrentModelName(InitDataPostArgs);
	GetTd(getModelConfigObject(InitDataPostArgs), g_InitEvent);


	setInterval(JsonFunction, 250);
}

	

function getModelConfigObject(InitDataPostArgs){
	if(typeof InitDataPostArgs == 'undefined'){
		InitDataPostArgs = new Object();
	}

  	ModelConfig = new Object();
  	ModelConfig.ModelName = "Default Model";
  		category = new Object();
  		category.Index = -1;
  		category.Name = "";
  	ModelConfig.Category = category;
  	ModelConfig.Image = "Image";
  	ModelConfig.InfoText = "This model is ...";

  	outputResolution = new Object();
	  	outputResolution.Index = -1;
	  	outputResolution.name = "";
  	ModelConfig.OutputResolution = outputResolution;

  	funcPreselect = new Object();
  		funcPreselect.Index = -1;
  		funcPreselect.Name = "";
  	ModelConfig.FuncPreselect = funcPreselect;

  		type = new Object();
  		type.Index = -1;
  		type.Name = "";
  	ModelConfig.Type = type;

  	modelTypeDependent = new Object();
  	
  	modelTypeDependent.Rudder = -1;
  	modelTypeDependent.Wing = -1;
  	modelTypeDependent.Elevator = -1;
  		tailType = new Object();
  		tailType.Index = -1;
  		tailType.Name = "";
  	modelTypeDependent.TailType = tailType;
  
  		typeSwashPlates = new Object();
  		typeSwashPlates.Index = -1;
  		typeSwashPlates.Name = "";
  	modelTypeDependent.TypeSwashPlate = typeSwashPlates;
  		typeGyros = new Object();
  		typeGyros.Index = -1;
  		typeGyros.Name = "";
  	modelTypeDependent.TypeGyro = typeGyros;
  		engineGovernors = new Object();
  		engineGovernors.Index = -1;
  		engineGovernors.Name = "";
  	modelTypeDependent.EngineGovernor = engineGovernors;	
  		countSwashs = new Object();
  		countSwashs.Index = -1;
  		countSwashs.Name = "";
  	modelTypeDependent.CountSwash = countSwashs;
  		swashPlate = new Object();
  		swashPlate.Angle = new Array();
  		swashPlate.Index = -1;
  	modelTypeDependent.SwashPlates = new Array(swashPlate);
  	ModelConfig.ModelTypeDependent = modelTypeDependent;

	InitDataPostArgs.ModelConfig = ModelConfig;

	return InitDataPostArgs;
}



function onEVENT_INIT(e){
	try{
		
		$('#Model_Image').bind("click", function(){window.location.href = "9.4.0__FileManager.html?ManagementType=imageManagement&IsManager=0&LastURL=1.1.0__ModelConfiguration.html?Wizard=" + g_Wizard + "&SavePathObj=" + getSavePath() + "&SearchKeyNode=Image";});

		
		$('#Model_Name_List').bind("click", function(){showKeypad("Model_Name_List");});
		$('#Model_Info').bind("click", function(){showKeypad("Model_Info");});

		
		g_popupList_Indices["Model_Preselect"] = e.EventData.ModelConfig.FuncPreselect.Index;
		$('#Model_Preselect').bind("click", function(){showPopupList(this, e.EventData.PopUp.FunctionPreselect, false, true, g_popupList_Indices);});

		g_popupList_Indices["Model_Resolution"] = e.EventData.ModelConfig.OutputResolution.Index;
		$('#Model_Resolution').bind("click", function(){showPopupList(this, e.EventData.PopUp.OutputResolution, false, true, g_popupList_Indices);});




		

		g_numpadLimitObj = e.EventData.NumPadLimits;

		
		checkHTMLHeader('Model_Name');
		setHTML('Model_Name'      , e.EventData.ModelName);

		setHTML('Model_Name_List' , e.EventData.ModelConfig.ModelName);

		setHTML('Model_Image'     , e.EventData.ModelConfig.Image);
		setHTML('Model_Info'      , e.EventData.ModelConfig.InfoText);
		setHTML('Model_Resolution', e.EventData.ModelConfig.OutputResolution.Name);
		setHTML('Model_Preselect' , e.EventData.ModelConfig.FuncPreselect.Name);

		g_ModelType = e.EventData.ModelConfig.Type.Name;	

		switch(g_ModelType){
			case "Free":		break;
			case "Glider":											
			case "Plane": 		setHTML_GliderPlane(e);	break;	
			case "Helicopter":	$('#Navi_Button').removeAttr("href");
								$('#Navi_Button').bind("click", function(){
									setHeliTravel2Limits();
								});
								setHTML_Helicopter(e);	break;
		}

		initScrollbars('List_Container');
		g_isScrollbarInit = true;
	}catch(err){
		onError(err, "Error Init: ", false);
	}
}


function onEVENT_SET(e){
	try{
		if(e.EventData.error.code == 1860){
			showDialogbox("modelNameExistsConfig");
		}
		else if(e.cmd == "1"){
			if(g_Wizard){
				window.location.href = "1.1.1__StickModeSelection.html?Wizard=true";
			}			
		}
		else if(e.cmd == "5"){
			window.location.href = "1.0.0__ModelSettings.html";
		}
	}catch(err){
		onError(err, "Error Setdata: ", false);
	}	
}



function getSwashPlateConfigBlock(swash_plates, servosAtSwash){
	var displayStyle = 'display: none;';

	if(servosAtSwash == 4){
		displayStyle = "";
	}

	var OffsetIndex = 0;
	if(swash_plates == 1){
		OffsetIndex = 4;
	}

	htmlSwashPlateConfigBlock = '' +
		'<div id="Swash_Plate_' + swash_plates + '">' +
			'<div id="Plate_Config_Name_' + swash_plates + '" class="list_header" style="margin-top: 18px; padding: 0px 10px 0px 10px; width: 388px;">' +
				setSwashPlateConfigHeader(true, swash_plates) +
			'</div>' +
			'<div id="Plate_Servo_1_' + swash_plates + '" class="content_blocklist_row" style="border-width: 0px 0px 1px 0px;">' +
				'<div id="Plate_' + swash_plates + '_Angle_1_Label" class="blocklist_cell">' + 'Offset Winkel' + '</div>' +
				'<div id="Plate_' + swash_plates + '_Angle_1"       class="blocklist_cell" style="width: 219px;" onClick=\'showNumpad("Plate_' + swash_plates + '_Angle_1","DegreeSigned180");\'>' + g_SwashPlateServosStr[OffsetIndex + 0] + '</div>' +
			'</div>' +
			'<div id="Plate_Servo_2_' + swash_plates + '" class="content_blocklist_row" style="border-width: 0px 0px 1px 0px;">' +
				'<div id="Plate_' + swash_plates + '_Angle_2_Label" class="blocklist_cell">' + '2ter Punkt' + '</div>' +
				'<div id="Plate_' + swash_plates + '_Angle_2"       class="blocklist_cell" style="width: 219px;" onClick=\'showNumpad("Plate_' + swash_plates + '_Angle_2","DegreeUnsigned180", false, true);\'>' + g_SwashPlateServosStr[OffsetIndex + 1] + '</div>' +
			'</div>' +
			'<div id="Plate_Servo_3_' + swash_plates + '" class="content_blocklist_row" style="border-width: 0px 0px 1px 0px;">' +
				'<div id="Plate_' + swash_plates + '_Angle_3_Label" class="blocklist_cell">' + '3ter Punkt' + '</div>' +
				'<div id="Plate_' + swash_plates + '_Angle_3"       class="blocklist_cell" style="width: 219px;" onClick=\'showNumpad("Plate_' + swash_plates + '_Angle_3","DegreeUnsigned180", false, true);\'>' + g_SwashPlateServosStr[OffsetIndex + 2] + '</div>' +
			'</div>' +
			'<div id="Plate_Servo_4_' + swash_plates + '" class="content_blocklist_row" style="border-width: 0px 0px 1px 0px; ' + displayStyle + '">' +
				'<div id="Plate_' + swash_plates + '_Angle_4_Label" class="blocklist_cell">' + '4ter Punkt' + '</div>' +
				'<div id="Plate_' + swash_plates + '_Angle_4"       class="blocklist_cell" style="width: 219px;" onClick=\'showNumpad("Plate_' + swash_plates + '_Angle_4","DegreeUnsigned180", false, true);\'>' + g_SwashPlateServosStr[OffsetIndex + 3] + '</div>' +
			'</div>' +
		'</div>';

	return htmlSwashPlateConfigBlock;
}


function setSwashPlateConfigHeader(isInit, swash_plates){
	var swashPlateConfigHeader = 'Taumelscheibentyp';

	if(g_SwashPlates > 1){
		if(swash_plates == 0){
			swashPlateConfigHeader = 'Taumelscheibe 1 Konfiguration';
		}
		else{
			swashPlateConfigHeader = 'Taumelscheibe 2 Konfiguration';
		}
	}

	if(isInit){
		return swashPlateConfigHeader;
	}
	else{
		setHTML('Plate_Config_Name_' + swash_plates, swashPlateConfigHeader);

		return;	
	}
}


function setHTML_GliderPlane(e){
	
	showHTML('Control_Surfaces');
	showHTML('Tail_Type');
	

	
	g_ModelTail     = e.EventData.ModelConfig.ModelTypeDependent.TailType.Index;
	setHTML('Model_Tail_Type', e.EventData.ModelConfig.ModelTypeDependent.TailType.Name);

	g_popupList_Indices["Model_Tail_Type"] = g_ModelTail;
	$('#Model_Tail_Type').bind("click", function(){showPopupList(this, e.EventData.PopUp.ModelTailType, false, true, g_popupList_Indices);});

	
	g_ModelRudder = e.EventData.ModelConfig.ModelTypeDependent.Rudder;
	setHTML('Model_Rudder', g_ModelRudder);

	g_popupList_Indices["Model_Rudder"] = g_ModelRudder;
	$('#Model_Rudder').bind("click", function(){showPopupList(this, e.EventData.PopUp.ModelRudderCount, false, true, g_popupList_Indices);});

	
	g_ModelElevator = e.EventData.ModelConfig.ModelTypeDependent.Elevator;
	setHTML('Model_Elevator', g_ModelElevator);

	g_popupList_Indices["Model_Elevator"] = g_ModelElevator;
	$('#Model_Elevator').bind("click", function(){showPopupList(this, e.EventData.PopUp.ModelElevatorCount, false, true, g_popupList_Indices);});

	
	g_ModelWing = e.EventData.ModelConfig.ModelTypeDependent.Wing;
	setHTML('Model_Wing', g_ModelWing);

	g_popup_Wing_long = e.EventData.PopUp.ModelWingCount;
	g_popup_Wing_short = setPopupListObj(g_popup_Wing_long);

	g_popupList_Indices["Model_Wing"] = g_ModelWing;
	$('#Model_Wing').bind("click", function(){showPopupList(this, g_popup_Wing, false, true, g_popupList_Indices);});

	drawModelCanvas(g_ModelType, g_ModelTail, g_ModelWing, g_ModelElevator, g_ModelRudder);

	setHTML_TailType(g_ModelTail);	

	if(!g_Wizard){
		$('#Model_Preselect').addClass('no_edit');
		$('#Model_Tail_Type').addClass('no_edit');
		$('#Model_Wing').addClass('no_edit');
		$('#Model_Elevator').addClass('no_edit');
		$('#Model_Rudder').addClass('no_edit');
	}
}


