function setHTML_TailType(modelTailType){
	
	if(modelTailType == 3){
		if(getHTML('Model_Wing') < 2){
			defaultDelta = 2;
			submitSET("Model_Wing", defaultDelta);
			setHTML('Model_Wing', defaultDelta);
			g_popupList_Indices["Model_Wing"] = defaultDelta;
		}

		showHTML('Rudder');
		hideHTML('Elevator');
		$('#Model_Elevator').removeClass('no_edit');
		g_popup_Wing = g_popup_Wing_short;
	}

	
	if(modelTailType == 2){
		fixedElevator = 2;
		submitSET("Model_Elevator", fixedElevator);
		setHTML('Model_Elevator', fixedElevator);
		g_popupList_Indices["Model_Elevator"] = fixedElevator;
		hideHTML('Rudder');
		showHTML('Elevator');
		$('#Model_Elevator').addClass('no_edit');
		g_popup_Wing = g_popup_Wing_long;
	}

	
	if(modelTailType == 1){
		showHTML('Rudder');
		showHTML('Elevator');
		$('#Model_Elevator').removeClass('no_edit');
		g_popup_Wing = g_popup_Wing_long;
	}
}


