function setPopupListObj(obj){
	var newObj = new Array();

	for(var i = 2; i < obj.length; i++){
		newObj[i - 2] = obj[i];
	}

	return newObj;
}


function splitSwashPlateServoArray(offset){
	var angleArray = new Object();
	angleArray.Angle = new Array();
	angleArray.Index = 0;
	if(offset != 0){
		angleArray.Index = 1;
	}
	

	for(var i = 0; i < 4; i++){
		angleArray.Angle[i] = g_SwashPlateServos[i + offset];
	}

	return angleArray;
}


function getSavePath(){
	cmd = "set";
	ModelName = "model-settings";
	path = "www";
	str = encodeURI('{"' + cmd + '":{"' + ModelName + '":{"ModelConfig":{"Image":"' + path + '"}}}}'); 

	return str;
}


function setDependingLimits(tagId){
	var tempArray = tagId.split("_");
	var plateIndex = tempArray[1];
	var AngleIndex = parseInt(tempArray[3]) - 1;
	var offset = 0;

	if(plateIndex == "1"){
		offset = 4;
	}

	var maxValue = 0;

	for(var i = 1; i < 4; i++){
		if(i != AngleIndex){
			maxValue += g_SwashPlateServos[i + offset];
		}	
	}

	maxValue = 360 - maxValue;

	if(maxValue > 180){
		maxValue = 180;
	}

	numpadMaxValue = maxValue;
}

function setHeliTravel2Limits(){
	
	if(g_SwashPlateType > 2){
		var travelString = "";
		var swashPlate0 = [];
		var swashPlate1 = [];
		var isPlate0Changed = false;
		var isPlate1Changed = false;
		var isOnePlate = true;
		
		var offset = 0;
		if(g_SwashPlates == 2){
			offset = 4;
			isOnePlate = false;
		}
		
		
		for(var i = 0; i < (4 + offset); i++){
			
			if(((g_SwashPlateType == 3) && ((i != 3) || (i != 7))) || (g_SwashPlateType == 4)){
				
				if(i < 4){
					
					if(!isPlate0Changed){
						if((g_SwashPlateServosInit[i] != g_SwashPlateServos[i])){
							
							if(!isOnePlate){
								travelString+= "Plate 1:" + " ";
								travelString+= getHTML('Plate_0_Angle_' + (i + 1) + '_Label') + ", ";
								swashPlate0.push(i);
							}
							isPlate0Changed = true;
						}
					}	
					else{
						travelString+= getHTML('Plate_0_Angle_' + (i + 1) + '_Label') + ", ";
						swashPlate0.push(i);
					}
				}	
				else{
					if(!isPlate1Changed){
						if((g_SwashPlateServosInit[i] != g_SwashPlateServos[i])){
							
							if(isPlate0Changed){
								travelString = travelString.substring(0, travelString.length -2) + " " + " and" + " ";
							}
							travelString+= "Plate 2:" + " ";
							travelString+= getHTML('Plate_1_Angle_' + (i - 3) + '_Label') + ", ";
							swashPlate1.push(i - offset);
							isPlate1Changed = true;
						}
					}	
					else{
						travelString+= getHTML('Plate_1_Angle_' + (i - 3) + '_Label') + ", ";
						swashPlate1.push(i - offset);
					}	
				}
			}
		}
		if(travelString.length != 0){
			travelString = travelString.substring(0, travelString.length -2);
			alert(travelString);
			GetTd({"ModelWizard":{"cmd":5, "SwashPlates":[{"Index": 0, "Angle": swashPlate0},{"Index": 1, "Angle": swashPlate1}]}}, g_SetEvent, "5");
		}
		else{
			window.location.href = "1.0.0__ModelSettings.html";
		}
	}
	else{
		window.location.href = "1.0.0__ModelSettings.html";
	}
	
}











function getAttrObj(tagId, value){
	Attribute = new Object();

	if((tagId == "Model_Name_List") || (tagId == "Model_Info") || (tagId == "Model_Category") || (tagId == "Model_Image") || (tagId == "Model_Resolution") || (tagId == "Model_Preselect")){
		if(tagId == "Model_Name_List"){
			Attribute["ModelName"] = value;
			setHTML('Model_Name', value);

			return Attribute;
		}

		if(tagId == "Model_Info"){
			Attribute["InfoText"] = value;

			return Attribute;
		}

		if(tagId == "Model_Category"){
			Attribute["Category"] = value;

			return Attribute;
		}

		if(tagId == "Model_Image"){
			Attribute["Image"] = value;

			return Attribute;
		}

		if(tagId == "Model_Resolution"){
			Attribute["OutputResolution"] = value;

			return Attribute;
		}

		if(tagId == "Model_Preselect"){
			Attribute["FuncPreselect"] = value;

			return Attribute;
		}
	}
	else{
		Attribute["ModelTypeDependent"] = {};

		
		if(tagId == "Model_Tail_Type"){
			Attribute["ModelTypeDependent"]["TailType"] = value;
			g_ModelTail = value;

			return Attribute;
		}

		if(tagId == "Model_Wing"){
			Attribute["ModelTypeDependent"]["Wing"] = value;
			g_ModelWing = value;

			return Attribute;
		}

		if(tagId == "Model_Rudder"){
			Attribute["ModelTypeDependent"]["Rudder"] = value;
			g_ModelRudder = value;

			return Attribute;
		}

		if(tagId == "Model_Elevator"){
			Attribute["ModelTypeDependent"]["Elevator"] = value;
			g_ModelElevator = value;

			return Attribute;
		}
		
		if(tagId == "Model_Swash_Plate_Type"){
			Attribute["ModelTypeDependent"]["TypeSwashPlate"] = value;

			if(g_SwashPlateType > 2){
				canvas.remove();
			}
			else if (value > 2){
				if(g_SwashPlates < 1){
					g_SwashPlates = 1;
				}
				Attribute["ModelTypeDependent"]["CountSwash"] = g_SwashPlates;
				g_popupList_Indices["Model_Swash_Plates"] = g_SwashPlates;
				setHTML("Model_Swash_Plates", g_SwashPlatePopupObj[g_SwashPlates-1].Name);
			}
			
			g_SwashPlateType = value;
			g_ServosPerPlate = g_SwashPlateType;

			setHTML_SwashPlateConfig();

			Attribute["ModelTypeDependent"]["SwashPlates"] = {};
			Attribute["ModelTypeDependent"]["SwashPlates"] = [splitSwashPlateServoArray(0), splitSwashPlateServoArray(4)];

			return Attribute;
		}

		if(tagId == "Model_Swash_Plates"){
			Attribute["ModelTypeDependent"]["CountSwash"] = value;
			g_SwashPlates = value;
			setHTML_SwashPlateConfig();

			Attribute["ModelTypeDependent"]["SwashPlates"] = {};
			Attribute["ModelTypeDependent"]["SwashPlates"] = [splitSwashPlateServoArray(0), splitSwashPlateServoArray(4)];

			if(g_SwashPlateType > 2){
				canvas.remove();
			}

			return Attribute;
		}
		
		if(tagId == "Model_Engine_Governor"){
			Attribute["ModelTypeDependent"]["EngineGovernor"] = value;

			return Attribute;
		}
		
		if(tagId == "Model_Gyro_Type"){
			Attribute["ModelTypeDependent"]["TypeGyro"] = value;

			return Attribute;
		}
		var plateArray = tagId.split("_");

		if(plateArray[0] == "Plate"){
			var PlateIndex = parseInt(plateArray[1]);
			var AngleIndex = parseInt(plateArray[3])-1;
			var OffsetIndex = PlateIndex;

			if(PlateIndex == 1){
				OffsetIndex = 4;
			}

			g_SwashPlateServos[AngleIndex + OffsetIndex] = value;
			Attribute["ModelTypeDependent"]["SwashPlates"] = {};
			Attribute["ModelTypeDependent"]["SwashPlates"]["Object"] = splitSwashPlateServoArray(OffsetIndex);
			Attribute["ModelTypeDependent"]["SwashPlates"]["Index"] = PlateIndex;

			if(g_SwashPlateType > 2){
				canvas.remove();
			}

			return Attribute;
		}
	}

	return Attribute;
}


function submitSET(tagId, value){
	var xmlObj = new Object();

	
	ModelName = "model-settings";
	cmd = "set";
	ListType = "ModelConfig";
	Attr = new Object();
	Attr = getAttrObj(tagId, value);

	xmlObj = {};
	xmlObj[cmd] = {};
	xmlObj[cmd][ModelName] = {};
	xmlObj[cmd][ModelName][ListType] = {};
	xmlObj[cmd][ModelName][ListType] = Attr;
	

	if((g_ModelType == "Glider") || (g_ModelType == "Plane")){
		refreshModelCanvas(g_ModelType, g_ModelTail, g_ModelWing, g_ModelElevator, g_ModelRudder);
	}	
	else if(g_ModelType == "Helicopter"){
		drawHeliCanvas(g_SwashPlates, g_SwashPlateServos);
	}

	if(g_isScrollbarInit){
		ScrollRefresh();
	}

	GetTd(xmlObj, g_SetEvent, cmd);

	if(tagId == "Model_Tail_Type"){
		setHTML_TailType(g_ModelTail);
	}	
}


