function drawHeliServos(){
	var font_family = "NeoSans-Regular";

	var BUTTON_RADIUS = 11;

	var buttons  = canvas.set();
	var numbers  = canvas.set();
	var infos    = canvas.set();
	var labels   = canvas.set();

	if(g_SwashPlates == 1){
		var centerPosition = [];
			centerPosition[0] = 217;
			centerPosition[1] = 173;

		var PATH_RADIUS = 51;
	}
	else if(g_SwashPlates == 2){
		var center_top    = [];
			center_top[0] = 217;
			center_top[1] =  87;
		var center_bottom = [];
			center_bottom[0] = center_top[0];
			center_bottom[1] = 262;

		var PATH_RADIUS = 41;
	}

	var ARROW_RADIUS = PATH_RADIUS + 10;
	var LABEL_RADIUS = ARROW_RADIUS + 24;

	for(var j = 0; j < g_SwashPlates; j++){
		var sumAngle = -90;

		if(g_SwashPlates == 2){
			if(j == 0){
				var centerPosition = center_top;
			}
			else{
				var centerPosition = center_bottom;
			}
		}

		rt = canvas.rect(centerPosition[0] - 2, centerPosition[1] - 34, 4, 14).attr({fill: white, stroke: "none"});
		rz = canvas.circle(centerPosition[0],   centerPosition[1], 11).attr({fill: white, stroke: "none"});
		r  = canvas.circle(centerPosition[0],   centerPosition[1], PATH_RADIUS).attr({stroke: white, "stroke-width": "6px"});
		rt.g = rt.glow({color: black, offsetx: 2, offsety: 3, width: 1, opacity: 0.4, fill: true});
		rz.g = rz.glow({color: black, offsetx: 2, offsety: 3, width: 1, opacity: 0.4, fill: true});
		r.g  =  r.glow({color: black, offsetx: 2, offsety: 3, width: 6, opacity: 0.78});

		var startIndex = 0;

		if(j > 0){
			startIndex = 4;
		}

		var endIndex = startIndex + g_ServosPerPlate;

		for(var i = startIndex; i < endIndex; i++){
			var deg = parseInt(g_SwashPlateServos[i]);
			sumAngle += deg;
			
			var displayNumber = i + 1;

			if(displayNumber > 4){
				displayNumber -= 4;
			}
			
			if(displayNumber == 4 && Math.abs(g_SwashPlateServos[i]) > 39){
				drawArrow((g_SwashPlateServos[i - 1] + g_SwashPlateServos[i - 2] + g_SwashPlateServos[i - 3]), (g_SwashPlateServos[i] + g_SwashPlateServos[i - 1] + g_SwashPlateServos[i - 2] + g_SwashPlateServos[i - 3]), centerPosition[0], centerPosition[1], ARROW_RADIUS);
			}
			else if(displayNumber == 3 && Math.abs(g_SwashPlateServos[i]) > 39){
				drawArrow((g_SwashPlateServos[i - 1] + g_SwashPlateServos[i - 2]), (g_SwashPlateServos[i] + g_SwashPlateServos[i - 1] + g_SwashPlateServos[i - 2]), centerPosition[0], centerPosition[1], ARROW_RADIUS);
			}
			else if(displayNumber == 2 && Math.abs(g_SwashPlateServos[i]) > 39){
				drawArrow((g_SwashPlateServos[i - 1]), (g_SwashPlateServos[i] + g_SwashPlateServos[i - 1]), centerPosition[0], centerPosition[1], ARROW_RADIUS);
			}
			else if(Math.abs(g_SwashPlateServos[i]) > 39){
				drawArrow("Offset", g_SwashPlateServos[i], centerPosition[0], centerPosition[1], ARROW_RADIUS);
			}

			var button_x = toCoords(centerPosition, PATH_RADIUS, sumAngle, "x");
			var button_y = toCoords(centerPosition, PATH_RADIUS, sumAngle, "y");

			var label_x = toCoords(centerPosition, LABEL_RADIUS, sumAngle, "x");
			var label_y = toCoords(centerPosition, LABEL_RADIUS, sumAngle, "y");

			buttons.push(canvas.circle(button_x, button_y, BUTTON_RADIUS).attr({fill: blue2, stroke: black, "stroke-width": "1px", opacity: 1}));

			switch(i){
				case 0:		var x_offset = -6;	break;	
				case 1:		var x_offset = -5;	break;	
				case 2:		var x_offset = -5;	break;	
				case 3:		var x_offset = -6;	break;	
				default:	var x_offset = -6;
			}

			var labelOffset = 4;
			var AngleString = g_SwashPlateServos[i].toString();
			var AngleLength = AngleString.length;
			
			if(AngleLength == 4){
				labelOffset = 2;
			}

			numbers.push(canvas.print((button_x + x_offset), (button_y + 1), displayNumber, canvas.getFont(font_family), 18).attr({fill: white, stroke: "none"}));
			infos.push(canvas.rect((label_x - 22), (label_y - 11), 45, 23, 5).attr({fill: blue2, stroke: black, "stroke-width": "1px", opacity: 1}));
			labels.push(canvas.text(label_x + labelOffset, label_y, g_SwashPlateServos[i] + "").attr({"font-size": "18px", "font-family": font_family, fill: white, stroke: "none"}));
		}
	}
}


function drawArrow(fromAngle, toAngle, center_x, center_y, radius){
	var arrowType = "block-midium-short";

	var seg_path = "";
	var center = [];
	center[0] = center_x;
	center[1] = center_y;

	if(fromAngle == "Offset" && toAngle < 0){
		seg_path = arc(center, radius - 20, (toAngle + 285), 260);
	}
	else if(fromAngle == "Offset"){
		seg_path = arc(center, radius - 20, -80, toAngle - 105);
	}
	else{
		seg_path = arc(center, radius, fromAngle - 75, toAngle - 105);
	}

	seg_path_arc_shadow = canvas.path(seg_path).attr({stroke: "#222222", "stroke-width": "5px", "arrow-end": arrowType, "arrow-start": arrowType});
	seg_path_arc = canvas.path(seg_path).attr({stroke: blue2, "stroke-width": "3px", "arrow-end": arrowType, "arrow-start": arrowType});
}


