function arc(center, radius, startAngle, endAngle){
	var startX = toCoords(center, radius, startAngle, "x");
	var startY = toCoords(center, radius, startAngle, "y");

	var endX = toCoords(center, radius, endAngle, "x");
	var endY = toCoords(center, radius, endAngle, "y");

	var path = "M" + startX + "," + startY + " A" + radius + "," + radius + " 0 0,1 " + endX + "," + endY;
	
	return path;
}


function toCoords(center, radius, angle, direction){
	var radians = (angle / 180) * Math.PI;
	var x = center[0] + Math.cos(radians) * radius,
		y = center[1] + Math.sin(radians) * radius;

	if(direction == "x"){
		return x;
	}
	else{
		return y;
	}
}
